import './estilo.css';
import LogoClaro from '../../assets/logo-marca-claro.jpg';
import Logo from '../../assets/logo-marca-claro.jpg';
import iconeSol from '../../assets/sun.png';
import iconeLua from '../../assets/moon.png';

export default function Topo(props){
    return(
        <header>
                <img className='icone-logo' src={props.ehTemaEscuro ? Logo : LogoClaro} alt="logo"/>
            
            <div className="topo-links">
                <a href="">Home</a>
                <a href="">Sobre</a>
                <a href="">Projetos</a>
                <a href="">Contato</a>
            </div>
            <button on><img className='imgButton' src={props.ehTemaEscuro ? iconeSol : iconeLua} alt="icone"/></button>
        </header>
    );
}
